import React from 'react'
import "./userList.css"
import { DataGrid } from '@material-ui/data-grid';


export default function UserList() {
  const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'username', headerName: 'Username', width: 200 },
  { field: 'email', headerName: 'email', width: 200 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'fullName',
    headerName: 'Full name',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 170,
   },
];

const rows = [
  { id: 1, username: 'Snow Jon', avater: 'img', email: 'jon@gemial.com', status: 'active', transction: '$200' },
  { id: 2, username: 'Lannister Cersei', avater: 'img', email: 'cersei@gemial.com', status: 'active', transction: '$200' },
  { id: 3, username: 'Lannister Jaime', avater: 'img', email: 'jaime@gemial.com', status: 'active', transction: '$200' },
  { id: 4, username: 'Stark  Arya', avater: 'img', age: 'arya@gemial.com', status: 'active', transction: '$200' },
  { id: 5, username: 'Targaryen Daenerys', avater: 'img', email: 'daenery@gemial.com',status: 'active', transction: '$200' },
  { id: 6, username: 'Melisandre', avater: 'img', email: 'melisandre@gemial.com', status: 'active', transction: '$200' },
  { id: 7, username: 'Clifford Ferrara', avater: 'img', email: 'Ferrara@gemial.com', status: 'active', transction: '$200' },
  { id: 8, username: 'Frances Rossini', avater: 'img', email: 'Rossisi@gemial.com', status: 'active', transction: '$200' },
  { id: 9, username: 'Roxie Harvey', avater: 'img', email: 'harvey@gemial.com', status: 'active', transction: '$200' },
];

    return (
        <div className="userList">
          <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} pageSize={5} checkboxSelection />
    </div> 
        </div>
    )
}
